window.addEventListener("load",()=>{const e=bootstrap.Offcanvas.getOrCreateInstance("#navOffcanvas");document.querySelectorAll(".offcanvas-link").forEach(t=>{t.addEventListener("click",t=>{t.preventDefault(),e.toggle();const a=t.currentTarget.href;setTimeout(()=>{window.location=a},400)})}),document.querySelectorAll(".video-unactivated").forEach(e=>{e.addEventListener("click",t=>{null==t.target.href&&(t.preventDefault(),console.log(t),e.classList.remove("video-unactivated"),e.innerHTML='<iframe width="560" height="315" src="'+e.dataset.video+'" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>')})})});